pub enum TypeKind {
    Unknown,
    Nil,
    Boolean,
    Number,
    Integer,
    String,
    Table,
    Function,
    Thread,
    Custom(String),
    Union(Vec<TypeKind>),
    Array(Box<TypeKind>),
    Generic(String),
    Applied {
        base: Box<TypeKind>,
        args: Vec<TypeKind>,
    },
    FunctionSig(Box<FunctionType>),
}

impl TypeKind {
    pub fn describe(&self) -> &'static str {
        match self {
            TypeKind::Unknown => "unknown",
            TypeKind::Nil => "nil",
            TypeKind::Boolean => "boolean",
            TypeKind::Number => "number",
            TypeKind::Integer => "integer",
            TypeKind::String => "string",
            TypeKind::Table => "table",
            TypeKind::Function => "function",
            TypeKind::Thread => "thread",
            TypeKind::Custom(_) => "custom",
            TypeKind::Union(_) => "union",
            TypeKind::Array(_) => "array",
            TypeKind::Generic(_) => "generic",
            TypeKind::Applied { .. } => "applied",
            TypeKind::FunctionSig(_) => "function",
        }
    }

    pub fn matches(&self, other: &TypeKind) -> bool {
        if matches!(self, TypeKind::Unknown) || matches!(other, TypeKind::Unknown) {
            return true;
        }

        match self {
            TypeKind::Union(types) => types.iter().any(|t| t.matches(other)),
            TypeKind::Generic(_) => true,
            TypeKind::FunctionSig(expected) => match other {
                TypeKind::Union(types) => types.iter().any(|t| self.matches(t)),
                TypeKind::FunctionSig(actual) => {
                    if expected.params.len() != actual.params.len() {
                        return false;
                    }
                    if expected.returns.len() != actual.returns.len() {
                        return false;
                    }
                    for (expected_param, actual_param) in expected.params.iter().zip(&actual.params)
                    {
                        if expected_param.is_vararg != actual_param.is_vararg {
                            return false;
                        }
                        if !expected_param.ty.matches(&actual_param.ty) {
                            return false;
                        }
                    }
                    match (&expected.vararg, &actual.vararg) {
                        (Some(expected_vararg), Some(actual_vararg)) => {
                            if !expected_vararg.matches(actual_vararg) {
                                return false;
                            }
                        }
                        (None, None) => {}
                        _ => return false,
                    }
                    for (expected_ret, actual_ret) in expected.returns.iter().zip(&actual.returns) {
                        if !expected_ret.matches(actual_ret) {
                            return false;
                        }
                    }
                    true
                }
                TypeKind::Function => true,
                _ => false,
            },
            TypeKind::Function => match other {
                TypeKind::Union(types) => types.iter().any(|t| self.matches(t)),
                TypeKind::FunctionSig(_) => true,
                _ => self == other,
            },
            TypeKind::Custom(_) => match other {
                TypeKind::Union(types) => types.iter().any(|t| self.matches(t)),
