fn is_annotation_leading(lines: &[&str], line: usize, column: usize) -> bool {
    if line == 0 {
        return false;
    }
    match lines.get(line.saturating_sub(1)) {
        Some(text) => text
            .chars()
            .take(column.saturating_sub(1))
            .all(char::is_whitespace),
        None => true,
    }
}

